import axios from 'axios';

const LoginService = {
    login: async function(username, passwrord) {
        const response = await axios({
            method: 'post',
            url: 'http://localhost/testsite/api/auth/generate_auth_token',
            data: {
                username: 'jcewinski@stardust-americana.com',
                passwrord: '!NQOG1t$gCwH@'
            }
        });
        
        console.log(response);
    }
};

export default LoginService;
